export const ViewServices = (props) => {
    const Data = props.Data;
    const servicesArray = props.servicesArray;
    const costData = props.costData;
    const tableInstance = TableInstances(Data);
    const [graphFlag, setGraphFlag] = React.useState(false);
    const { getTableProps, getTableBodyProps, headerGroups, page, nextPage, previousPage, prepareRow, canNextPage, canPreviousPage, pageOptions, state, gotoPage, pageCount, setPageSize } = tableInstance;
    return (
        <div>
            {Data && Data.length > 0 ? (

                <div className='instances'>
                    {!graphFlag ? (<div className="mt-4"   >
                        <table {...getTableProps()} className="min-w-full divide-y divide-gray-200">
                            <thead>
                                {headerGroups.map((headerGroup) => (

                                    <tr {...headerGroup.getHeaderGroupProps()}>
                                        {headerGroup.headers.map((column) => (
                                            <th {...column.getHeaderProps(column.getSortByToggleProps())}>
                                                {column.render("Header")}
                                                <span>
                                                    {column.isSorted
                                                        ? column.isSortedDesc
                                                            ? ' ðŸ”½'
                                                            : ' ðŸ”¼'
                                                        : ''}
                                                </span>
                                            </th>
                                        ))}
                                    </tr>
                                ))}
                            </thead>
                            <tbody {...getTableBodyProps()}>
                                {page.map((row) => {
                                    prepareRow(row);
                                    return (
                                        <tr {...row.getRowProps()}>
                                            {row.cells.map(cell => {
                                                return <td {...cell.getCellProps()}>{cell.render("Cell")}</td>;
                                            })}
                                        </tr>
                                    );
                                })}
                            </tbody>
                        </table>
                        <div className="page-selector">
                            <span>
                                Page {' '}
                                <strong>
                                    {state.pageIndex + 1} of {pageOptions.length}
                                </strong>
                            </span>
                            <select value={state.pageSize} onChange={(e) => (
                                setPageSize(e.target.value)
                            )}>{
                                    [10, 25, 40].map(pageSize => (
                                        <option key={pageSize} value={pageSize}>
                                            show {pageSize}
                                        </option>
                                    ))
                                }

                            </select>
                        </div>
                        <div className="pagination-buttons">

                            <button  onClick={() => gotoPage(0)} disabled={!canPreviousPage}>{'<<'} </button>
                            <button  onClick={() => previousPage()} disabled={!canPreviousPage}>PreviousPage</button>
                            <button  onClick={() => nextPage()} disabled={!canNextPage}>NextPage</button>
                            <button  onClick={() => gotoPage(pageCount - 1)} disabled={!canNextPage}>{'>>'}</button>
                            go to page:
                            <input type="number" defaultValue={state.pageIndex + 1} onChange={e => {
                                const pageNumber = e.target.value ? Number(e.target.value) - 1 : 0
                                gotoPage(pageNumber)
                            }}></input>

                            <button  onClick={() => setGraphFlag(!graphFlag)}>View in PieChart</button>
                        </div>

                    </div >) : (<div>
                        <PieChart servicesArray={servicesArray} costData={costData} />
                        <button  onClick={() => setGraphFlag(!graphFlag)}>View in Tables</button>
                    </div>)}
                </div>
            ) : (
                <Loading />
            )}



        </div>
    )
}



